#对话
Teaching_Feeling_dialogue:"[Teaching_Feeling_dialogue_tt]"
#1
Teaching_Feeling_dialogue_tt_1:"…。" 
Teaching_Feeling_dialogue_tt_2:"（希露薇什麼也不做，只是靜靜地待在那兒。" 
Teaching_Feeling_dialogue_tt_3:"…怎麼了嗎？"
#2
Teaching_Feeling_dialogue_tt_4:"（正打量著她時視線對上了。"
Teaching_Feeling_dialogue_tt_5:"（看到了印在雪白肌膚上的鮮紅傷疤。"
Teaching_Feeling_dialogue_tt_6:"您說這身傷疤嗎？"
Teaching_Feeling_dialogue_tt_7:"這些是前陣子的舊傷，現在已經不太會痛了。"
Teaching_Feeling_dialogue_tt_8:"（仔細看了一下並不是剛受的傷，似乎不需要包繃帶了。"
#3
Teaching_Feeling_dialogue_tt_9:"您要聊天嗎？"
Teaching_Feeling_dialogue_tt_10:"說起來，其實我對這類事情不是很了解……。"
Teaching_Feeling_dialogue_tt_11:"（似乎不打算繼續聊下去的樣子。"
#4
Teaching_Feeling_dialogue_tt_12:"（之前都過著怎樣的生活呢。"
Teaching_Feeling_dialogue_tt_13:"還待在上一位主人身邊時的事情嗎？"
Teaching_Feeling_dialogue_tt_14:"除了每天被鞭打外，還有各種隨著日子而不同的待遇…。"
Teaching_Feeling_dialogue_tt_15:"既沒有親人，在被前一位主人蓄養前也是待在某個孤兒院裡。"
Teaching_Feeling_dialogue_tt_16:"實在是沒什麼能拿來聊的…。"
Teaching_Feeling_dialogue_tt_17:"沒什麼話題能用了嗎。"
#5
Teaching_Feeling_dialogue_tt_18:"（觀察希露薇的傷痕…。"
Teaching_Feeling_dialogue_tt_19:"皮膚上的疤，是被塗上腐蝕性藥水所留下的。"
Teaching_Feeling_dialogue_tt_20:"我並不太想去回憶。"
#6
Teaching_Feeling_dialogue_tt_21:"雖然我怕痛…。"
Teaching_Feeling_dialogue_tt_22:"但我並沒有要反抗主人的意思。"
Teaching_Feeling_dialogue_tt_23:"（似乎並非沒有厭惡的情感。"
#7
Teaching_Feeling_dialogue_tt_24:"（隔著那件破布衣也能看出她纖弱又嬌小的身體。"
Teaching_Feeling_dialogue_tt_25:"深沉的銀色頭髮與眼瞳令人印象深刻。"
Teaching_Feeling_dialogue_tt_26:"…怎麼了嗎？"

#8
Teaching_Feeling_dialogue_tt_27:"（試著撫摸希露薇的頭。"
Teaching_Feeling_dialogue_tt_28:"…那個，要對我做什麼？"
Teaching_Feeling_dialogue_tt_29:"…您在摸我的頭嗎？"
Teaching_Feeling_dialogue_tt_30:"是那樣沒錯，只是…。"
#9
Teaching_Feeling_dialogue_tt_31:"…？"
Teaching_Feeling_dialogue_tt_32:"（擺出了很困惑的表情。"
#10
Teaching_Feeling_dialogue_tt_33:"…。"
Teaching_Feeling_dialogue_tt_34:"（沒有甚麼特別的反應。"
#11
Teaching_Feeling_dialogue_tt_35:"…。"
Teaching_Feeling_dialogue_tt_36:"…這樣做有什麼意味嗎？"
#12
Teaching_Feeling_dialogue_tt_37:"…。"
Teaching_Feeling_dialogue_tt_38:"我，不太明白。"
#13
Teaching_Feeling_dialogue_tt_39:"…。"
Teaching_Feeling_dialogue_tt_40:"（頭髮柔軟的觸感傳到了手上。"
#14
Teaching_Feeling_dialogue_tt_41:"…。"
Teaching_Feeling_dialogue_tt_42:"請照您喜歡的那樣做…。"
#15
Teaching_Feeling_dialogue_tt_43:"…。"
Teaching_Feeling_dialogue_tt_44:"（希露薇空蕩蕩地眼神望著天空。"
#16
Teaching_Feeling_dialogue_tt_45:"…怎麼了嗎？"
Teaching_Feeling_dialogue_tt_46:"（觀察了一下後稍微有點在意。"
#17
Teaching_Feeling_dialogue_tt_47:"疼痛之類的…跟剛開始比起來已經習慣了。"
#18
Teaching_Feeling_dialogue_tt_48:"那個，您什麼都不做嗎…？"
#19
Teaching_Feeling_dialogue_tt_49:"如果有命令的話，能做得到的我會做…。"
#20
Teaching_Feeling_dialogue_tt_50:"請照主人喜歡的做。"
Teaching_Feeling_dialogue_tt_51:"因為我只是奴隸而已。"
#21
Teaching_Feeling_dialogue_tt_52:"沒有表情…是嗎？"
Teaching_Feeling_dialogue_tt_53:"不好意思，這點已經變成習慣了。"
#22
Teaching_Feeling_dialogue_tt_54:"主人特意為我準備的食物，單是看著就很美觀呢。"
Teaching_Feeling_dialogue_tt_55:"（與麵包和水相比的話的確如此。"
#23
Teaching_Feeling_dialogue_tt_56:"心這種東西，明明沒有的話就好了…。"
#24
Teaching_Feeling_dialogue_tt_57:"如果主人想要這樣的話，我只能接受。"
Teaching_Feeling_dialogue_tt_58:"我知道自己沒有拒絕的權力。"
#25
Teaching_Feeling_dialogue_tt_59:"您不對我做和前一個主人一樣的事情嗎？"
#26
Teaching_Feeling_dialogue_tt_60:"因為我做不來需要力氣的勞動，所以之前被打得高聲慘叫就是我的工作。"
